import React, { useState } from "react"; // Import useState from react
import './Home.css';
import letter from './letter.gif'; // Import the GIF file
import valentine from './Beval';

const Home = () => {
    const [showQuiz, setShowQuiz] = useState(false);

    const handleClick = () => {
        // Run your script here to create a quiz
        console.log("Quiz created!");

        // Show the quiz by updating state
        setShowQuiz(true);
    };

    return(
        <div className="home">
            {showQuiz ? (
                <valentine />
            ) : (
                <img 
                    src={letter} 
                    alt="GIF" 
                    onClick={handleClick} 
                    style={{ width: '600px', height: 'auto', cursor: 'pointer' }} 
                />
            )}
        </div>
    );
}

export { Home };
